import React from 'react';
import teamData from './team-data';

export default function DraftCompiler(teamIds){

    text = ""

    teamIds.map( (value, index) => {

        newLine = teamData[value].name
        text.concat("Pick # " + index + ":\t\t\tSpeedhawk McGee\nby the " + newLine + "\n")

    })

}
